document.addEventListener("DOMContentLoaded", function () {
  const pixButtons = document.querySelectorAll(".link-pix");

  pixButtons.forEach(function (button) {
    button.addEventListener("click", function (event) {
      event.preventDefault();

      const itemPreco = this.closest(".item").querySelector(".item-preco");
      const preco = itemPreco.textContent;


      const imagemBase64 = 'data:image/jpeg;base64,';

      Swal.fire({
        title: "Pix: Cleomar de Souza Pontes Filho\n(92) 99483-0999",
        text: `Valor: ${preco}`,
        icon: "info",
        imageUrl: imagemBase64, // Insira o código base64 da imagem aqui
        imageWidth: 200,
        imageHeight: 200,
        confirmButtonText: "OK",
        customClass: {
          title: "sweetalert-title", // Nome da classe para o título
          content: "sweetalert-content" // Nome da classe para o conteúdo
        },
        fontFamily: 'work-sans', // Tipo de fonte desejado
      });
    });
  });
});
